/**
 * Created by ovesh on 25/8/20.
 */
import React from 'react';
import App from "./App";



function SignUp(){
    return (
        <div>
           <App/>
            <div>
                <div align="center"
                     style={{
                         padding:'50px 50px'
                     }}>
                    <Link to="/">Login</Link>
                    <hr width='30%'/>
                    <Link to="resetPassword">Reset Password</Link>
                </div>
            </div>
        </div>
    );
}


export default SignUp;
